CREATE DEFINER=`brett`@`%` PROCEDURE `getValueId`(
   ownerId BIGINT,
   parentValueId BIGINT,
   objectIndex BIGINT,
   objectKey TEXT
)
BEGIN
   SET @ownerId = ownerId,
            @parentValueId = parentValueId,
            @objectIndex = objectIndex,
            @objectKey = objectKey,
            @valueId = NULL,
            @type = NULL,
            @locked = NULL;
        
            
    IF @objectKey IS NOT NULL THEN
        SELECT
            v.locked
        INTO
            @locked
        FROM
            Value AS v
        WHERE 
            v.ownerId = @ownerId
        AND
           v.parentValueId = 
               @parentValueId
       AND
           v.objectKey = @objectKey
       AND
           v.locked = 1;
       # FOR UPDATE;
       

       SELECT
            v.valueId
        INTO
            @valueId
        FROM
            Value AS v
        WHERE
            v.ownerId = @ownerId
         AND
             v.parentValueId = 
               @parentValueId
       AND
           v.objectKey = @objectKey
       AND
           v.locked = 0;
       #FOR UPDATE;
   ELSE
        SELECT
            v.locked
        INTO
            @locked
        FROM
            Value AS v
        WHERE 
            v.ownerId = @ownerId
        AND
           v.parentValueId = 
               @parentValueId
       AND
              v.objectIndex = @objectIndex
       AND
              v.locked = 1;
       #FOR UPDATE;

       SELECT
            v.valueId
        INTO
            @valueId
        FROM
            Value AS v
        WHERE
            v.ownerId = @ownerId
        AND
            v.parentValueId = 
               @parentValueId
       AND
              v.objectIndex = @objectIndex
       AND
              v.locked = 0;
       #FOR UPDATE;
   END IF;
   
   
   IF @valueId IS NOT NULL THEN
       SELECT
            v.type,
            v.objectIndex,
            v.objectKey
       INTO
           @type,
           @objectIndex,
           @objectKey
       FROM
           Value AS v
       WHERE
           v.valueId = @valueId
       FOR UPDATE;
    END IF;
           
   IF @locked IS NULL THEN
       SET @locked = 0;
   END IF;
   
   SELECT
            @valueId AS valueId,
            @type AS type,
            @locked as locked,
            @objectIndex AS objectIndex,
            @objectKey AS objectKey;
            
END ;;
DELIMITER ;
