CREATE DEFINER=`brett`@`%` PROCEDURE `getValuesById`(
   ownerId BIGINT,
   valueId BIGINT
)
BEGIN
   SET @ownerId = ownerId,
            @valueId = valueId;
            
   SELECT         Value.*,
                            (
                                  SELECT COUNT(*)
                                  FROM    Value
                                  WHERE  
                                       Value.ownerId = 
                                       @ownerId
                                 AND
                                       Value.parentValueId = 
                                        @valueId
                                  AND
                                        Value.locked = 0
                            ) as childCount
   FROM            Value
   WHERE         Value.valueId = 
                            @valueId;
   
END ;;
