CREATE DEFINER=`brett`@`%` PROCEDURE `insertParentValueWords`(
    valueId BIGINT
)
BEGIN

    START TRANSACTION;
    
    SET @valueId = valueId;
    
    INSERT
    INTO
            ValueWord(
                valueId,
                wordId
            )
    SELECT DISTINCT
        @valueId,
        ValueWord.wordId
    FROM
        Value
    INNER JOIN
        ValueWord
    ON
        ValueWord.valueId = Value.parentValueId
    WHERE
        Value.valueId = @valueId
    AND
        NOT EXISTS(
            SELECT
                *
            FROM
               ValueWord AS vw
            WHERE
                vw.valueId = @valueId
            AND
                vw.wordId = ValueWord.wordId
        );
        
    COMMIT;
    
END ;;
