CREATE DEFINER=`brett`@`%` PROCEDURE `insertValueWord`(
    valueId BIGINT,
    word BLOB
)
BEGIN

   START TRANSACTION;
    
    SET @valueId = valueId,
             @word = word,
             @wordId = NULL;
             
    SELECT
        Word.wordId
    INTO
        @wordId
    FROM
        Word
    WHERE
        Word.word = @word
    FOR UPDATE;
     
    IF @wordId IS NULL THEN
       INSERT
       INTO
           Word(word)
       VALUES(
           @word
        );
        
        SET @wordId = LAST_INSERT_ID();
        
    END IF;
    
    INSERT
    INTO
        ValueWord(
            valueId,
            wordId
        )
    SELECT 
        @valueId,
        @wordId
   WHERE
       NOT EXISTS(
           SELECT
               *
           FROM
               ValueWord
           WHERE
                ValueWord.valueId = @valueId
            AND
                ValueWord.wordId = @wordId
       );
       
   COMMIT;
    
END ;;
